import React from 'react';
import ReactDOM from 'react-dom';

import Table from './components/Table';
import TableHeader from './components/TableHeader';

const App = () => {

    return (<div>
        <TableHeader/>
        <Table />
    </div>);
};

ReactDOM.render(<App/>, document.getElementById('root'));
